    function buyEgc() public payable {
        if (msg.value < oneEGC) {
            emit ReceivedLessThanTarget(msg.sender, msg.value);
            revert("Received amount is less than the target amount");
        }
        emit Received(msg.sender, msg.value);

        payments[msg.sender].push(Payment({
            sender: msg.sender,
            amount: msg.value,
